import './css/App.css'
import './css/colors.css'
import Navbar from './navbar'

function App() {
    return (
        <>
      <BrowserRouter>
          <Routes>
            <Route path='/' element={<Login/>} />
            <Route path='/login' element={<Login/>} />
            <Route path='/register' element={<Register/>} />
        </Routes>
      </BrowserRouter>
    </>
    );
}

export default App;
